import React, { useEffect } from "react";
import axios from "axios";

const About = () => {
  useEffect(() => {
    const getData = async () => {
      const data = await axios("https://jsonplaceholder.typicode.com/todos/1");
    };
  }, []);

  return <>About</>;
};

export default About;
